class Solution:

    def calculateMinimumHP(self, dungeon):
        """
         :type dungeon: List[List[int]]
         :rtype: int
         """
        m, n = len(dungeon), len(dungeon[0])
        dp = [[0 for _ in range(n)] for _ in range(m)]
        dp[m - 1][n - 1] = max(1 - dungeon[m - 1][n - 1], 0)
        for i in range(m - 2, -1, -1):
            dp[i][n - 1] = max(1 - dungeon[i][n - 1] + dp[i + 1][n - 1], 0)
        for j in range(n - 2, -1, -1):
            dp[m - 1][j] = max(1 - dungeon[m - 1][j] + dp[m - 1][j + 1], 0)
        for i in range(m - 2, -1, -1):
            for j in range(n - 2, -1, -1):
                dp[i][j] = max(1 - dungeon[i][j] + min(dp[i + 1][j], dp[i][j + 1]), 0)
        return dp[0][0]

