def myceil(x, y):
    return (x + y - 1) // y

def myfloor(x, y):
    return x // y

def mypow(x, y):
    if y == 0:
        return 1
    if y % 2 == 1:
        return x * mypow(x, y - 1)
    else:
        return mypow(x, y // 2) * mypow(x, y // 2)

def mypowmod(x, y, p):
    if y == 0:
        return 1
    if y % 2 == 1:
        return (x * mypowmod(x, y - 1, p)) % p
    else:
        return mypowmod(x, y // 2, p) * mypowmod(
            x, y // 2, p) % p

def gcd(a, b):
    if a == 0:
        return b
    return gcd(b % a, a)

def lcm(a, b):
    return a * b // gcd(a, b)

def isPrime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i = i + 6
    return True

def ispalindrome(s):
    return s == s[::-1]

def toposort(v):
    visited = [0 for i in range(len(v))]
    stack = []
    for i in range(len(v)):
        if not visited[i]:
            stack.append(i)
            while stack:
                u = stack.pop()
                visited[u] = 1
                for i in v[u]:
                    if not visited[i]:
                        stack.append(i)
    return stack

def isSubsequence(s1, s2):
    i = 0
    for i in range(len(s2)):
        if s2[i] == s1[i]:
            i = i + 1
        if i == len(s1):
            break
    return True if i == len(s1) else False

def find_gcd(a, b):
    while b:
        a, b = b, a % b
    return a

def binary_search(arr, x):
    low = 0
    high = len(arr) - 1
    while low <= high:
        mid = (high + low) // 2
        if arr[mid] < x:
            low = mid + 1
        elif arr[mid] > x:
            high = mid - 1
        else:
            return mid
    return -1

