    def majorityElement(self, nums):
        """
         :type nums: List[int]
         :rtype: List[int]
         """
        count = {}
        for num in nums:
            if num in count:
                count[num] += 1
            else:
                count[num] = 1
        return [num for num in count if count[num] > len(nums) // 3]

