def is_respectable(points):
    x = sorted([point[0] for point in points])
    y = sorted([point[1] for point in points])
    if x[0] != y[0]:
        return False
    if x[1] != y[1]:
        return False
    if x[2] != y[2]:
        return False
    if x[2] == x[1]:
        return False
    if y[2] == y[1]:
        return False
    return True

