def suffix_array(s):
    l = sorted(s)
    return [l.index(c) for c in s]

def suffix_automaton(s):
    l = sorted(s)
    return [l.index(c) for c in s]

def solve(s, t):
    if s == t:
        return 'both'
    if s[-1] != t[-1]:
        return 'need tree'
    if len(s) == 1:
        return 'need tree'
    if len(s) == 2:
        return 'array'
    if len(s) == 3:
        return 'automaton'
    if s[-2:] == t[-2:]:
        return 'both'
    if s[-2:] != t[-2:]:
        return 'need tree'
    if s[-1] == t[-2]:
        return 'array'
    if s[-1] != t[-2]:
        return 'need tree'
    return 'automaton'

