def is_same(puzzle1, puzzle2):
    for i in range(2):
        for j in range(2):
            if puzzle1[i][j] != puzzle2[i][j]:
                return False
    return True

def is_solvable(puzzle):
    moves = 0
    for i in range(2):
        for j in range(2):
            if puzzle[i][j] == 'X':
                if i == 0:
                    if puzzle[i + 1][j] == 'A':
                        moves += 1
                    elif puzzle[i + 1][j] == 'B':
                        moves += 2
                    elif puzzle[i + 1][j] == 'C':
                        moves += 3
                elif i == 1:
                    if puzzle[i - 1][j] == 'A':
                        moves += 1
                    elif puzzle[i - 1][j] == 'B':
                        moves += 2
                    elif puzzle[i - 1][j] == 'C':
                        moves += 3
    return moves % 4 == 0

