def factoring(s):
    if len(s) == 1:
        return 1
    for i in range(1, len(s)):
        if s[:i] * (len(s) // i) == s:
            return factoring(s[:i]) + factoring(s[i:])


def max_factor(s):
    max = 0
    for i in range(1, len(s)):
        if s[:i] * (len(s) // i) == s:
            max = max if factoring(s[:i]) + factoring(s[i:]) < max else factoring(s[:i]) + factoring(s[i:])
    return max


